import React from 'react'
import prodcuts from '../products'
import {Row,Col} from 'react-bootstrap'

function HomeScreen() {
  return (
    <div>
       <h1>Latest Products</h1>
       <Row>
           {prodcuts.map(product=>(
               <Col sm={12} md={6} lg={4} xl={3}>
               <h3>{product.name}</h3>
               </Col>
           ))}
       </Row>
    </div>
  )
}

export default HomeScreen
